--
-- Table structure for table `CANHAN`
--

CREATE TABLE CANHAN (
  idCN int PRIMARY KEY,
  ho varchar(30) NOT NULL, 
  ten varchar(30)
);

--
-- Table structure for table `film`
--

CREATE TABLE film (
  idFilm int PRIMARY KEY,
  tua varchar(50) NOT NULL, 
  nguoithuchien integer,
  kinhphi   float ,
  foreign key(nguoithuchien)  REFERENCES CANHAN(idCN)
);

--
-- Table structure for table `DIENVIEN`
--

CREATE TABLE DIENVIEN (
  idFilm int ,
  idCN int ,
  thulao int,
  foreign key(idFilm)  REFERENCES film(idFilm),
  foreign key(idCN)  REFERENCES CANHAN(idCN),
  PRIMARY KEY (idFilm,idCN)
);

--
-- Table structure for table `LOAI`
--

CREATE TABLE LOAI (
  idLoai char(2) PRIMARY KEY,
  tenloai varchar(30) 
);

--
-- Table structure for table `LOAIPHIM`
--

CREATE TABLE LOAIPHIM (
  idFilm int,
  idLoai varchar(4) , 
   foreign key(idFilm)  REFERENCES film(idFilm),
  foreign key(idLoai)  REFERENCES LOAI(idLoai),
  PRIMARY KEY (idFilm,idLoai)
);

